import "./Task2Page.css";

import PropositionsPane from "../components/PropositionsPane";
import TaskDescription from "../components/TaskDescription";

export default function Task2Page() {
    const taskDescription =
        "How do you characterize the activity in the video? \
         Please specify propositions that distinguish this activity from any other activity";

    return (
        <div id="main-container">
            <h1>Task 2</h1>
            <div id="lef-pane-div">
                <TaskDescription></TaskDescription>
                <PropositionsPane
                    rows={5}
                    cols={35}
                    options={["sometimes", "usually", "always"]}
                ></PropositionsPane>
            </div>
        </div>
    );
}
